window.bookSummaryJSON = "<p>With the fate of Aradia in Áine's hands, she must choose between letting the love of her life die or submitting to the Shadow King.</p> <p>While rebellion against the Kingdom intensifies across the realm, Áine, Daelon, and the Icierans are drawn to Aurora Aurea, where witches are gathering to build an army. Áine and Daelon's relationship is put to the test when Daelon's body and mind are ravaged by poison. As the sickness draws out Daelon's dark side, Áine must reckon with her own shadow self, a beast that grows ever stronger as her mountain of secrets reaches new heights.</p> <p>Lucius, who continues to mystify Áine with his mercurial demeanor and endless contradictions, only works harder to win over his Queen.</p> <p>When Daelon's time runs short, no one is prepared for the chaos, betrayal, and upheaval that sends shockwaves across the witch realm and throughout the universe.</p> <p>Contains mature themes.</p>"; 
